import React, { useState } from 'react';
import {
  TextField, Button, Typography, Box, Container, Grid
} from '@mui/material';
import emailjs from '@emailjs/browser';

const CreateProjectPage = () => {
  const [tripData, setTripData] = useState({
    customer_id: '',
    trip_name: '',
    start_date: '',
    end_date: '',
    trip_type: ''
  });

  const [groupMembers, setGroupMembers] = useState([{ name: '', email: '' }]);

  const handleTripChange = e => {
    setTripData({ ...tripData, [e.target.name]: e.target.value });
  };

  const handleGroupMemberChange = (index, field, value) => {
    const updated = [...groupMembers];
    updated[index][field] = value;
    setGroupMembers(updated);
  };

  const addGroupMember = () => {
    setGroupMembers([...groupMembers, { name: '', email: '' }]);
  };

  const removeGroupMember = index => {
    const updated = [...groupMembers];
    updated.splice(index, 1);
    setGroupMembers(updated);
  };

  const sendInviteEmail = (member, tripName) => {
    emailjs.send(
      'service_7gpzfjq',
      'template_dl2uq6v',
      {
        to_name: member.name,
        to_email: member.email,
        trip_name: tripName,
        join_link: 'http://localhost:3000/register'
      },
      'QlIA9_4mrMcOxdFcK'
    ).then(
      result => console.log('Email sent to', member.email),
      error => console.error('Email send error:', error)
    );
  };

  const handleSubmit = async () => {
    try {
      const response = await fetch('http://localhost:5000/create-trip', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(tripData)
      });

      if (!response.ok) throw new Error('Trip creation failed');

      const tripResult = await response.json();

      for (let member of groupMembers) {
        await fetch('http://localhost:5000/add-group-member', {
          method: 'POST',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify({
            trip_id: tripResult.trip_id,
            customer_id: tripData.customer_id,
            member_name: member.name,
            member_email: member.email
          })
        });

        sendInviteEmail(member, tripData.trip_name);
      }

      alert('Trip and invitations successfully created.');
    } catch (err) {
      console.error('Error submitting trip:', err);
      alert('Failed to create trip or send invitations.');
    }
  };

  return (
    <Container maxWidth="md">
      <Typography variant="h4" gutterBottom>Create a New Trip</Typography>

      <Grid container spacing={2}>
        <Grid item xs={6}>
          <TextField fullWidth label="Customer ID" name="customer_id" value={tripData.customer_id} onChange={handleTripChange} />
        </Grid>
        <Grid item xs={6}>
          <TextField fullWidth label="Trip Name" name="trip_name" value={tripData.trip_name} onChange={handleTripChange} />
        </Grid>
        <Grid item xs={6}>
          <TextField fullWidth type="date" label="Start Date" name="start_date" InputLabelProps={{ shrink: true }} value={tripData.start_date} onChange={handleTripChange} />
        </Grid>
        <Grid item xs={6}>
          <TextField fullWidth type="date" label="End Date" name="end_date" InputLabelProps={{ shrink: true }} value={tripData.end_date} onChange={handleTripChange} />
        </Grid>
        <Grid item xs={12}>
          <TextField fullWidth label="Trip Type" name="trip_type" value={tripData.trip_type} onChange={handleTripChange} />
        </Grid>
      </Grid>

      <Box mt={4}>
        <Typography variant="h5">Group Members</Typography>
        {groupMembers.map((member, index) => (
          <Box key={index} mt={2} display="flex" gap={2}>
            <TextField
              label="Name"
              value={member.name}
              onChange={(e) => handleGroupMemberChange(index, 'name', e.target.value)}
            />
            <TextField
              label="Email"
              value={member.email}
              onChange={(e) => handleGroupMemberChange(index, 'email', e.target.value)}
            />
            <Button onClick={() => removeGroupMember(index)} color="error">Remove</Button>
          </Box>
        ))}
        <Button onClick={addGroupMember} sx={{ mt: 2 }}>Add Group Member</Button>
      </Box>

      <Box mt={4}>
        <Button variant="contained" color="primary" onClick={handleSubmit}>Save Trip & Send Invites</Button>
      </Box>
    </Container>
  );
};

export default CreateProjectPage;
